function jump_page() {
  page_index_jump = parseInt(document.getElementById('page_index_jump').value) - 1;
  if (isNaN(page_index_jump) || page_index_jump < 0 || page_index_jump >= my_table.page.info().pages) {
    return;
  }
  my_table.page(page_index_jump).draw(false);
}